import React, {Component} from 'react';
import '../App.css';

class Grid extends Component {

    constructor(props) {
        super(props);
        this.state = {
            lefttab: [
                {
                    id:1,
                    Name:'Bob',
                    completed: false
                },
                {
                    id:2,
                    title:'Maria',
                    completed: false 
                },
                {
                    id:3,
                    title:'Kevin',
                    completed: false 
                },
                {
                    id:4,
                    title: 'Jose',
                    completed: false
                },
            ]
        };
      }

    render() {
        return (
            <div className = 'Grid'>
                {this.state.value}
            </div>
        )
      }
}

export default Grid;
